import React from "react";
import "./APIData.css"
const Data = (props) => {
  //   let tempProp = Object.assign({}, props.result);

  //   console.log(tempProp);
  return (
    <div>
      <li className=".api">
       <h2>{props}</h2>
       <h3>{props}</h3>
      </li>
    </div>
  );
};
export default Data;
